import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { RouterModule, Routes } from '@angular/router';
import { FormsModule } from '@angular/forms';
import { AuthGuard } from './auth.guard'; 

import { AppComponent } from './app.component';
import { HttpClientModule } from '@angular/common/http';
import { HomeComponent } from './home/home.component';
import { SpellListComponent } from './spell-list/spell-list.component';
import { DeitiesComponent } from './deities/deities.component';
import { PotionsComponent } from './potions/potions.component';
import { SpellShareComponent } from './spell-share/spell-share.component';
import { LoginComponent } from './login/login.component';
import { SecureComponent } from './secure/secure.component';

const appRoutes: Routes = [
  { path: '', canActivate: [AuthGuard], component: HomeComponent },
  { path: 'login', component: LoginComponent },
  { path: 'spells', component: SpellListComponent },
  { path: 'deities', component: DeitiesComponent },
  { path: 'potions', component: PotionsComponent },
  { path: 'spell-share', component: SpellShareComponent }
];

@NgModule({
  declarations: [
    AppComponent,

    HomeComponent,
    SpellListComponent,
    DeitiesComponent,
    PotionsComponent,
    SpellShareComponent,
    LoginComponent,
    SecureComponent
  ],
  imports: [
    BrowserModule,
    FormsModule,
    HttpClientModule,
    RouterModule.forRoot(appRoutes)
  ],
  providers: [AuthGuard],
  bootstrap: [AppComponent]
})
export class AppModule { }
